import FancyButton from "../UI/FancyButton";
import Card from "../UI/Card";
import shirtHeaderImg from "../../assets/test.png";
import booksHeader from "../../assets/booksHeader.png";
import styles from "./WelcomeFunctional.module.css";

import { useNavigate } from "react-router-dom";

const WelcomeFunctional = () => {
  const navigate = useNavigate();

  const navHandlerShirts = () => {
    navigate("/shirts");
  };

  const navHandlerBooks = () => {
    navigate("/books");
  };

  return (
    <section>
      <FancyButton />
      <Card>
        <div className={styles.card}>
          <div>
            <h3> Shirts</h3>
          </div>
          <div>
            <img
              onClick={navHandlerShirts}
              src={shirtHeaderImg}
              alt="Shirt "
              height="100px"
              width="300px"
            />
          </div>
        </div>
      </Card>
      <Card>
        <div className={styles.card}>
          <div>
            <h3> Books</h3>
          </div>
          <div>
            <img
              onClick={navHandlerBooks}
              src={booksHeader}
              alt="Book "
              height="100px"
              width="300px"
            />
          </div>
        </div>
      </Card>
    </section>
  );
};

export default WelcomeFunctional;
